import React, { Component } from "react";
 
export default class Feed extends Component {
  render() {
    return (
      <div>
        <h2>FEED</h2>
        <p>Feed Content</p>
        
    <div className="postContainer">
        <div className="post">
            <div className="postInfo">
                <p>User1 posted</p>
            </div>
            
            <div className="postTitle">
                <p>Top 5 Post-Title</p>
            </div>

        </div>


    </div>


      </div>
    );
  }
}
